import React, { useState } from 'react';
import axios from 'axios';

function UserEntry() {
  const [formData, setFormData] = useState({
    fullName: '',
    dob: '',
    address: '',
    phoneNumber: '',
    emailAddress: '',
    employmentDetails: '',
    bankingInformation: '',
    creditHistory: '',
    assetsLiabilities: '',
    maritalStatus: '',
    uniqueNumber: '',
    document: null 
  });

  const handleChange = e => {
    if (e.target.name === 'document') {
      setFormData({ ...formData, [e.target.name]: e.target.files[0] }); 
    } else {
      setFormData({ ...formData, [e.target.name]: e.target.value });
    }
  };

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      const formDataToSend = new FormData();
      formDataToSend.append('fullName', formData.fullName);
      formDataToSend.append('dob', formData.dob);
      formDataToSend.append('address', formData.address);
      formDataToSend.append('phoneNumber', formData.phoneNumber);
      formDataToSend.append('emailAddress', formData.emailAddress);
      formDataToSend.append('employmentDetails', formData.employmentDetails);
      formDataToSend.append('bankingInformation', formData.bankingInformation);
      formDataToSend.append('creditHistory', formData.creditHistory);
      formDataToSend.append('assetsLiabilities', formData.assetsLiabilities);
      formDataToSend.append('maritalStatus', formData.maritalStatus);
      formDataToSend.append('uniqueNumber', formData.uniqueNumber);
      formDataToSend.append('document', formData.document);

      const res = await axios.post('http://localhost:3005/users', formDataToSend, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });
      console.log(res.data);
      setFormData({
        fullName: '',
        dob: '',
        address: '',
        phoneNumber: '',
        emailAddress: '',
        employmentDetails: '',
        bankingInformation: '',
        creditHistory: '',
        assetsLiabilities: '',
        maritalStatus: '',
        uniqueNumber: '',
        document: ''
      });
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <form onSubmit={handleSubmit} className='Type-Form'>
      <div className='Main-InputFlied'>
        <div className='Personal-Info'>
          <label htmlFor="fullName">Full Name:</label>
          <input type="text" name="fullName" placeholder="Full Name" value={formData.fullName} onChange={handleChange} />

          <label htmlFor="dob">Date of Birth:</label>
          <input type="date" name="dob" value={formData.dob} onChange={handleChange} />

          <label htmlFor="address">Address:</label>
          <input type="text" name="address" placeholder="Address" value={formData.address} onChange={handleChange} />

          <label htmlFor="phoneNumber">Phone Number:</label>
          <input type="text" name="phoneNumber" placeholder="Phone Number" value={formData.phoneNumber} onChange={handleChange} />

          <label htmlFor="emailAddress">Email Address:</label>
          <input type="email" name="emailAddress" placeholder="Email Address" value={formData.emailAddress} onChange={handleChange} />
        </div>
      
        <div className='Employment-Info'>
          <label htmlFor="employmentDetails">Employment Details:</label>
          <input type="text" name="employmentDetails" placeholder="Employment Details" value={formData.employmentDetails} onChange={handleChange} />

          <label htmlFor="bankingInformation">Banking Information:</label>
          <input type="text" name="bankingInformation" placeholder="Banking Information" value={formData.bankingInformation} onChange={handleChange} />

          <label htmlFor="creditHistory">Credit History:</label>
          <input type="text" name="creditHistory" placeholder="Credit History" value={formData.creditHistory} onChange={handleChange} />

          <label htmlFor="assetsLiabilities">Assets and Liabilities:</label>
          <input type="text" name="assetsLiabilities" placeholder="Assets and Liabilities" value={formData.assetsLiabilities} onChange={handleChange} />

          <label htmlFor="maritalStatus">Marital Status:</label>
          <input type="text" name="maritalStatus" placeholder="Marital Status" value={formData.maritalStatus} onChange={handleChange} />

          <label htmlFor="uniqueNumber">Unique Number:</label>
          <input type="text" name="uniqueNumber" placeholder="Unique Number" value={formData.uniqueNumber} onChange={handleChange} />

          <label htmlFor="document">Document:</label>
          <input type="file" name="document" onChange={handleChange} />
        </div>
      </div>

      <div className='Main-Button'>
        <button type="submit">Submit</button>
      </div>
    </form>
  );
}

export default UserEntry;
